        func makeStat(name: String, carl: Set<String>, macs: Set<String>) {
            print("\n\n \(name) \n\n")
            print("***** Intersection *****")
            
            let union = carl.intersection(macs)
            print("\n\n Common items: \(union.count)\n")
            printSet(set:union)
            
            print("\n\n***** CARL *****")
            
            let carlDiff = carl.subtracting(macs)
            print("\n\n CARL diff items: \(carlDiff.count)\n")
            printSet(set:carlDiff)
            
            print("\n\n***** MACS *****")
            
            let macsDiff = macs.subtracting(carl)
            print("\n\n MACS diff items: \(macsDiff.count)\n")
            printSet(set:macsDiff)
        }
        
        
